(window.webpackJsonp=window.webpackJsonp||[]).push([[53],{615:function(module,exports){eval('module.exports = "<h1 id=\\"spacing\\"><span class=\\"bd-content-title\\">Spacing</span></h1>\\n<p class=\\"bd-lead\\">Bootstrap v4 CSS includes a wide range of shorthand responsive margin and padding utility classes\\nto modify an element&#39;s appearance.</p>\\n<h2 id=\\"how-it-works\\"><span class=\\"bd-content-title\\">How it works<a class=\\"anchorjs-link\\" href=\\"#how-it-works\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>Assign responsive-friendly margin or padding values to an element or a subset of its sides with\\nshorthand classes. Includes support for individual properties, all properties, and vertical and\\nhorizontal properties. Classes are built from a default Sass map ranging from .25rem to 3rem.</p>\\n<h2 id=\\"notation\\"><span class=\\"bd-content-title\\">Notation<a class=\\"anchorjs-link\\" href=\\"#notation\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>Spacing utilities that apply to all breakpoints, from xs to xl, have no breakpoint abbreviation in\\nthem. This is because those classes are applied from <code translate=\\"no\\" class=\\"notranslate\\">min-width: 0</code> and up, and thus are not bound\\nby a media query. The remaining breakpoints, however, do include a breakpoint abbreviation.</p>\\n<p>The classes are named using the format <code translate=\\"no\\" class=\\"notranslate\\">{property}{sides}-{size}</code> for <code translate=\\"no\\" class=\\"notranslate\\">xs</code> and\\n<code translate=\\"no\\" class=\\"notranslate\\">{property}{sides}-{breakpoint}-{size}</code> for <code translate=\\"no\\" class=\\"notranslate\\">sm</code>, <code translate=\\"no\\" class=\\"notranslate\\">md</code>, <code translate=\\"no\\" class=\\"notranslate\\">lg</code>, and <code translate=\\"no\\" class=\\"notranslate\\">xl</code>.</p>\\n<p>Where <em><code translate=\\"no\\" class=\\"notranslate\\">property</code></em> is one of:</p>\\n<ul>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">m</code> - for classes that set margin</li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">p</code> - for classes that set padding</li>\\n</ul>\\n<p>Where <em><code translate=\\"no\\" class=\\"notranslate\\">sides</code></em> is one of:</p>\\n<ul>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">t</code> - for classes that set <code translate=\\"no\\" class=\\"notranslate\\">margin-top</code> or <code translate=\\"no\\" class=\\"notranslate\\">padding-top</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">b</code> - for classes that set <code translate=\\"no\\" class=\\"notranslate\\">margin-bottom</code> or <code translate=\\"no\\" class=\\"notranslate\\">padding-bottom</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">l</code> - for classes that set <code translate=\\"no\\" class=\\"notranslate\\">margin-left</code> or <code translate=\\"no\\" class=\\"notranslate\\">padding-left</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">r</code> - for classes that set <code translate=\\"no\\" class=\\"notranslate\\">margin-right</code> or <code translate=\\"no\\" class=\\"notranslate\\">padding-right</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">x</code> - for classes that set both <code translate=\\"no\\" class=\\"notranslate\\">*-left</code> and <code translate=\\"no\\" class=\\"notranslate\\">*-right</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">y</code> - for classes that set both <code translate=\\"no\\" class=\\"notranslate\\">*-top</code> and <code translate=\\"no\\" class=\\"notranslate\\">*-bottom</code></li>\\n<li>blank - for classes that set <code translate=\\"no\\" class=\\"notranslate\\">margin</code> or <code translate=\\"no\\" class=\\"notranslate\\">padding</code> on all 4 sides of the element</li>\\n</ul>\\n<p>Where <em><code translate=\\"no\\" class=\\"notranslate\\">size</code></em> is one of:</p>\\n<ul>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">0</code> - for classes that eliminate the margin or padding by setting it to <code translate=\\"no\\" class=\\"notranslate\\">0</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">1</code> - (by default) for classes that set the <code translate=\\"no\\" class=\\"notranslate\\">margin</code> or <code translate=\\"no\\" class=\\"notranslate\\">padding</code> to <code translate=\\"no\\" class=\\"notranslate\\">$spacer * .25</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">2</code> - (by default) for classes that set the <code translate=\\"no\\" class=\\"notranslate\\">margin</code> or <code translate=\\"no\\" class=\\"notranslate\\">padding</code> to <code translate=\\"no\\" class=\\"notranslate\\">$spacer * .5</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">3</code> - (by default) for classes that set the <code translate=\\"no\\" class=\\"notranslate\\">margin</code> or <code translate=\\"no\\" class=\\"notranslate\\">padding</code> to <code translate=\\"no\\" class=\\"notranslate\\">$spacer</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">4</code> - (by default) for classes that set the <code translate=\\"no\\" class=\\"notranslate\\">margin</code> or <code translate=\\"no\\" class=\\"notranslate\\">padding</code> to <code translate=\\"no\\" class=\\"notranslate\\">$spacer * 1.5</code></li>\\n<li><code translate=\\"no\\" class=\\"notranslate\\">5</code> - (by default) for classes that set the <code translate=\\"no\\" class=\\"notranslate\\">margin</code> or <code translate=\\"no\\" class=\\"notranslate\\">padding</code> to <code translate=\\"no\\" class=\\"notranslate\\">$spacer * 3</code></li>\\n</ul>\\n<p><em>(You can add more sizes by adding entries to the <code translate=\\"no\\" class=\\"notranslate\\">$spacers</code> Sass map variable.)</em></p>\\n<h2 id=\\"examples\\"><span class=\\"bd-content-title\\">Examples<a class=\\"anchorjs-link\\" href=\\"#examples\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>Here are some representative examples of these classes:</p>\\n<pre class=\\"hljs css text-monospace p-2 notranslate\\" translate=\\"no\\"><span class=\\"hljs-selector-class\\">.mt-0</span> {\\n  <span class=\\"hljs-attribute\\">margin-top</span>: <span class=\\"hljs-number\\">0</span> <span class=\\"hljs-meta\\">!important</span>;\\n}\\n\\n<span class=\\"hljs-selector-class\\">.ml-1</span> {\\n  <span class=\\"hljs-attribute\\">margin-left</span>: ($spacer * <span class=\\"hljs-number\\">0.25</span>) <span class=\\"hljs-meta\\">!important</span>;\\n}\\n\\n<span class=\\"hljs-selector-class\\">.px-2</span> {\\n  <span class=\\"hljs-attribute\\">padding-left</span>: ($spacer * <span class=\\"hljs-number\\">0.5</span>) <span class=\\"hljs-meta\\">!important</span>;\\n  <span class=\\"hljs-attribute\\">padding-right</span>: ($spacer * <span class=\\"hljs-number\\">0.5</span>) <span class=\\"hljs-meta\\">!important</span>;\\n}\\n\\n<span class=\\"hljs-selector-class\\">.p-3</span> {\\n  <span class=\\"hljs-attribute\\">padding</span>: $spacer <span class=\\"hljs-meta\\">!important</span>;\\n}</pre><h2 id=\\"horizontal-centering\\"><span class=\\"bd-content-title\\">Horizontal centering<a class=\\"anchorjs-link\\" href=\\"#horizontal-centering\\" aria-label=\\"Anchor\\"></a></span></h2>\\n<p>Additionally, Bootstrap also includes an <code translate=\\"no\\" class=\\"notranslate\\">.mx-auto</code> class for horizontally centering fixed-width\\nblock level content — that is, content that has <code translate=\\"no\\" class=\\"notranslate\\">display: block</code> and a <code translate=\\"no\\" class=\\"notranslate\\">width</code> set—by setting the\\nhorizontal margins to <code translate=\\"no\\" class=\\"notranslate\\">auto</code>.</p>\\n<pre class=\\"hljs html text-monospace p-2 notranslate\\" translate=\\"no\\"><span class=\\"hljs-tag\\">&lt;<span class=\\"hljs-name\\">div</span> <span class=\\"hljs-attr\\">class</span>=<span class=\\"hljs-string\\">\\"mx-auto bg-info\\"</span> <span class=\\"hljs-attr\\">style</span>=<span class=\\"hljs-string\\">\\"width: 200px;\\"</span>&gt;</span>Centered element<span class=\\"hljs-tag\\">&lt;/<span class=\\"hljs-name\\">div</span>&gt;</span>\\n\\n<span class=\\"hljs-comment\\">&lt;!-- horizontal-centering.vue --&gt;</span></pre>";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///615\n')}}]);